import React from 'react';
import ReactDOM from 'react-dom';

const data = [
	{
		name: 'Charlie',
		job: 'Janitor',
	},
	{
		name: 'Mac',
		job: 'Bouncer',
	},
	{
		name: 'Dee',
		job: 'Aspiring actress',
	},
	{
		name: 'Dennis',
		job: 'Bartender',
	},
]

class TableHeader extends React.Component {
	render() {
		return (
			<thead>
				<tr>
					<th>Name</th>
					<th>Job</th>
				</tr>
			</thead>
		)
	}
}

class TableBody extends React.Component {
	render() {
		return (
			<tbody>
				<tr>
					<td>Charlie</td>
					<td>Janitor</td>
				</tr>
				<tr>
					<td>Mac</td>
					<td>Bouncer</td>
				</tr>
				<tr>
					<td>Dee</td>
					<td>Aspiring actress</td>
				</tr>
				<tr>
					<td>Dennis</td>
					<td>Bartender</td>
				</tr>
			</tbody>
		)
	}
}
class Table extends React.Component {
	render() {
		return (
			<table>
				<TableHeader />
				<TableBody />
			</table>
		)
	}
}


ReactDOM.render(<Table />, document.getElementById('root'));
